import React, {useState, useEffect} from 'react';

const axios = require('axios');

export const History = () => {
    const [data,setData]=useState([]);

    /* construct url queries */
    const url = 'http://localhost:3001/fires?Counties=';
    const arr = ["Sonoma", "Butte", "Napa"];
    const queries = arr.map(county => axios.get(url+county));
    let temp = [];

    /* set state data */
    const getData = () => {
        axios.all(queries)
        .then(resArr => {
            temp = resArr.map(resArr => resArr.data);
            setData(temp)
        });
    };

    useEffect(()=>{
        getData();
    },[])

    console.log(data);

    return(
        <p>hi</p>
    );
};
